import React, { Component } from 'react';
import { Router, Route, Switch, Redirect } from 'react-router-dom';
import BikeList from './components/bikes/BikeList';


class App extends Component {

  render() {

    return (
          <Switch>
          <Route exact path='/' component={BikeList} />

          </Switch>
    );
  }
}


export default App;
